    <script>


        playableAds.createVideo(background, {
            loop: [ // 循环播放数据(单位秒) 如果没有的话就整个视频循环
                {
                    start: 0,
                    end: 2
                }
            ],
            clickToGameEndDelay: 0, // 点击到达次数时，延迟多少ms跳gameEnd，0的话视频播放完或者点击就跳
            bgm: './resource/bgm.mp3'
        })


        window.onload = function () {
            window.gameReady && window.gameReady()
            log('gameReady')
        }

        function gameStart() {
            playableAds.playVideo()
            playableAds.playEnterSound()
            log('gameStart')
        }

        function gameClose() {
            window.destorySound && window.destorySound()
        }
